body:
@Tofuman the letter said Thank you for letting me stay for the night! I want to let you know that even if yesterday's income was 0 it didn't affected me too much. You know... When I was singing, Nii-san, you went to the public and shouted ''whoever this girl is, she'll definitely be famous in the future, and I promise to help her reach her dreams!''
I was so embarrassed but it made me happy. 
If I'd stay with you I'm going to fall in love with you for sure. So, to reach my dreams that you supported I'll do my best! I'll definitely do it so you better keep cheering me on. With love, An, I leave you with my most precious thing
